          "I arrivied at Integrify Acadamy at 9:00 Am. Early morning, I started to code review with my code review with my classmates for about an hour, I had a scrum meeting for about 10 minutes which started at 10 :00 AM . After that, I "
      }
    ]
  };

  render() {
    return (
      <div className="App">
        <Navigation />
        <Home />
        <Addpost />
      </div>
    );
  }
}

export default App;
